import React, { useEffect, useState } from 'react';
import './Predictor.module.css';
import axios from 'axios';
import {
  Container, Paper, Typography, Table, TableBody,
  TableCell, TableContainer, TableHead, TableRow
} from '@mui/material';

const PredictionHistory = () => {
  const [history, setHistory] = useState([]);
  const [clicked, setClicked] = useState(false); // Added state for navbar toggle

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const response = await axios.get('http://localhost:5000/history');
        setHistory(response.data);
      } catch (error) {
        console.error('Error fetching prediction history:', error);
      }
    };

    fetchHistory();
  }, []);

  const handleClick = () => {
    setClicked(!clicked); // Toggle the navbar
  };

  return (
    <>
      <nav className="navbar-admin">
        <a href="#">
          <svg id="logo-15" 
              width="49" 
              height="48" 
              viewBox="0 0 49 48" 
              fill="none" 
              xmlns="http://www.w3.org/2000/svg"> 
            <path d="M24.5 12.75C24.5 18.9632 19.4632 24 13.25 24H2V12.75C2 6.53679 7.03679 1.5 13.25 1.5C19.4632 1.5 24.5 6.53679 24.5 12.75Z" className="ccustom" fill="#17CF97"></path> 
            <path d="M24.5 35.25C24.5 29.0368 29.5368 24 35.75 24H47V35.25C47 41.4632 41.9632 46.5 35.75 46.5C29.5368 46.5 24.5 41.4632 24.5 35.25Z" className="ccustom" fill="#17CF97"></path> 
            <path d="M2 35.25C2 41.4632 7.03679 46.5 13.25 46.5H24.5V35.25C24.5 29.0368 19.4632 24 13.25 24C7.03679 24 2 29.0368 2 35.25Z" className="ccustom" fill="#17CF97"></path>
            <path d="M47 12.75C47 6.53679 41.9632 1.5 35.75 1.5H24.5V12.75C24.5 18.9632 29.5368 24 35.75 24C41.9632 24 47 18.9632 47 12.75Z" className="ccustom" fill="#17CF97"></path>
          </svg>
        </a>
        <div>
          <ul id="navbar">
            <li><a className="active" href="/userAcc">Back</a></li>
            <li><a href="/login">Log Out</a></li>
          </ul>
        </div>
      </nav>
      <Container maxWidth="lg">
        <Paper elevation={3} style={{ padding: '20px', marginTop: '20px' }}>
          <Typography variant="h4" align="center" gutterBottom style={{ fontWeight: 'bold' }}>
            Prediction History
          </Typography>
          <TableContainer>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell align="center">Pregnancies</TableCell>
                  <TableCell align="center">Glucose</TableCell>
                  <TableCell align="center">Blood Pressure</TableCell>
                  <TableCell align="center">Skin Thickness</TableCell>
                  <TableCell align="center">Insulin</TableCell>
                  <TableCell align="center">BMI</TableCell>
                  <TableCell align="center">Diabetes Pedigree Function</TableCell>
                  <TableCell align="center">Age</TableCell>
                  <TableCell align="center">Result</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {history.map((entry, index) => (
                  <TableRow key={index}>
                    <TableCell align="center">{entry.features.Pregnancies || 'N/A'}</TableCell>
                    <TableCell align="center">{entry.features.Glucose || 'N/A'}</TableCell>
                    <TableCell align="center">{entry.features.BloodPressure || 'N/A'}</TableCell>
                    <TableCell align="center">{entry.features.SkinThickness || 'N/A'}</TableCell>
                    <TableCell align="center">{entry.features.Insulin || 'N/A'}</TableCell>
                    <TableCell align="center">{entry.features.BMI || 'N/A'}</TableCell>
                    <TableCell align="center">{entry.features.DiabetesPedigreeFunction || 'N/A'}</TableCell>
                    <TableCell align="center">{entry.features.Age || 'N/A'}</TableCell>
                    <TableCell align="center">
                      {entry.result === 'not diabetic' ? 'Not Diabetic' : 'Diabetic'}
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Paper>
      </Container>
    </>
  );
};

export default PredictionHistory;
